import React from "react";

const VideoDetail = ({ video }) => {
  return (
    <section>
      <iframe
        type="text/html"
        width="100%"
        height="500px"
        src={`http://www.youtube.com/embed/${video.id}`}
        frameborder="0"
      ></iframe>
    </section>
  );
};

export default VideoDetail;
